INSERT INTO `com_jour` (`ID`, `COM_QUES`, `COM_ANS`, `CREATED_ON`, `USER_ID`) VALUES
(1, 'Write about going back to school after summer vacation.', NULL, '2017-05-30 15:59:22', 1),
(2, 'Write a thank you note to a friend who gave you onion and garlic-flavored chewing gum.', NULL, '2017-05-30 15:59:22', 1),
(3, 'Draw an imaginary constellation. Write a story such as ancient people might have told about it.', NULL, '2017-05-30 15:59:22', 1),
(4, 'Describe a real made-up dream or nightmare.', NULL, '2017-05-30 15:59:22', 1),
(5, 'Write about your favorite childhood toy.', NULL, '2017-05-30 15:59:22', 1),
(6, 'Write out the best or the worst day of your life.', 'Headline features:\r\n\r\nElegant dependency tracking - automatically updates the right parts of your UI whenever your data model changes.\r\nDeclarative bindings - a simple and obvious way to connect parts of your UI to your data model. You can construct a complex dynamic UIs easily using arbitrarily nested binding contexts.\r\nTrivially extensible - implement custom behaviors as new declarative bindings for easy reuse in just a few lines of code.\r\nAdditional benefits:\r\n\r\nPure JavaScript library - works with any server or client-side technology\r\nCan be added on top of your existing web application without requiring major architectural changes\r\nCompact - around 13kb after gzipping\r\nWorks on any mainstream browser (IE 6+, Firefox 2+, Chrome, Safari, Edge, others)\r\nComprehensive suite of specifications (developed BDD-style) means its correct functioning can easily be verified on new browsers and platforms\r\nDevelopers familiar with Ruby on Rails, ASP.NET MVC, or other MV* technologies may see MVVM as a real-time form of MVC with declarative syntax. In another sense, you can think of KO as a general way to make UIs for editing JSON dataâ€¦ whatever works for you :)', '2017-05-30 15:59:22', 1),
(7, 'Finish this thought: if I could change one thing about myself (if you can not think of anything, you might want to consider telling how you got to be perfect!)', NULL, '2017-05-30 15:59:22', 1),
(8, 'If and when I raise children, I will never...', NULL, '2017-05-30 15:59:22', 1),
(9, 'I have never been more frightened than when...', NULL, '2017-05-30 15:59:22', 1),
(10, 'Persuade a friend to give up drugs.', NULL, '2017-05-30 15:59:22', 1),
(11, 'Five years from now, I will be...', NULL, '2017-05-30 15:59:22', 1),
(12, 'Write about a day you would like to forget.', NULL, '2017-05-30 15:59:22', 1),
(13, 'Invent and describe a new food.', NULL, '2017-05-30 15:59:22', 1),
(14, 'Describe an event that changed your life forever, or make up and describe an event that would change your life forever.', NULL, '2017-05-30 15:59:22', 1),
(15, 'Describe someone who is a hero to you and explain why.', NULL, '2017-05-30 15:59:22', 1),
(16, 'Write about a time in your life when you struggled with a choice and made the right one.', NULL, '2017-05-30 15:59:22', 1),
(17, 'Imagine yourself in a different century and describe an average day in your life.', NULL, '2017-05-30 15:59:22', 1),
(18, 'Which character from a book would you most like to meet and why?', NULL, '2017-05-30 15:59:22', 1),
(19, 'Three goals I have set for myself are...', NULL, '2017-05-30 15:59:22', 1),
(20, 'What would you do if 300 mice had just gotten out of their cages in a pet shop where you worked?', NULL, '2017-05-30 15:59:22', 1),
(21, 'What would you do if you were locked inside your favorite department store overnight?22.  What would you do if you woke up one morning to find yourself invisible?', NULL, '2017-05-30 15:59:22', 1),
(22, 'What would you do if you were able to communicate with animals?', NULL, '2017-05-30 15:59:22', 1),
(23, 'What would you do if you could travel into the future?', NULL, '2017-05-30 15:59:22', 1),
(24, 'What would you do if you could travel into the past?', NULL, '2017-05-30 15:59:22', 1),
(25, 'What would you do if someone just gave you $1 million?', NULL, '2017-05-30 15:59:22', 1),
(26, 'What would you do it all the electricity in the world just stopped?', NULL, '2017-05-30 15:59:22', 1),
(27, 'What would you do if you could travel free anyplace in the world?', NULL, '2017-05-30 15:59:22', 1),
(28, 'What would you do if the dinner served to you in a fancy restaurant came with a fly in the mashed potatoes?', NULL, '2017-05-30 15:59:22', 1),
(29, 'Write a list of at least 50 things that make you feel good.', NULL, '2017-05-30 15:59:22', 1),
(30, 'Describe the perfect day.  Put in as many details as you can.  Make it a possible day, not a "dream day."', NULL, '2017-05-30 15:59:22', 1),
(31, 'Who is the person from history that you would most like to meet and talk to?  Why?  What would you like to ask?', NULL, '2017-05-30 15:59:22', 1),
(32, 'Who is the person from literature that you would most like to meet and talk to?  Why?  What would you like to ask?', NULL, '2017-05-30 15:59:22', 1),
(33, 'Compile a list of words that describe you as a child.  Compile a second list that describes you as you are now.  How are these lists the same?  How are they different?', NULL, '2017-05-30 15:59:22', 1),
(34, 'Compile a list of inanimate or animate objects to which you might compare yourself metaphorically.  (I am a windmill.  I change direction or my thoughts whenever someone talks to me...)', NULL, '2017-05-30 15:59:22', 1),
(35, 'Tell about what triggers anger in you or someone else.', NULL, '2017-05-30 15:59:22', 1),
(36, 'Invent a monster and describe it.  Tell where it lives, what it eats, and what it does.', NULL, '2017-05-30 15:59:22', 1),
(37, 'What is your favorite kind of weather?  Why?', NULL, '2017-05-30 15:59:22', 1),
(38, 'What is the best book you have ever read?  Why did you like it?  Did reading the book change you in any way?  What way?', NULL, '2017-05-30 15:59:22', 1),
(39, 'Write about what you did not do this weekend.', NULL, '2017-05-30 15:59:22', 1),
(40, 'Think about an incident that happened to you and exaggerate in the telling. Make it into a tall tale.', NULL, '2017-05-30 15:59:22', 1),
(41, 'If you were ruler of the world, what things would you banish absolutely for all time (rain on weekends, eggplant, and so forth)?  Make a list.  Use your imagination.', NULL, '2017-05-30 15:59:22', 1),
(42, 'If you could go back in time anywhere and "anywhen," where/when would you go and why?', NULL, '2017-05-30 15:59:22', 1),
(43, 'What law would you like to see enacted which would help people?  How would it help?', NULL, '2017-05-30 15:59:22', 1),
(44, 'What commercial on TV do you dislike beyond all others?  What about it is particularly annoying to you?', NULL, '2017-05-30 15:59:22', 1),
